import React from "react";
import Button from "@mui/material/Button";
import { useState } from "react";

export default function Count() {
  const [count, setCount] = useState(0);

  return (
    <>
    <h1></h1>

    <Button 
    onClick={() => setCount(count + 1)}>
      +
      </Button>
    <Button
     onClick={() => setCount(count - 1)}>
      -
      </Button>
    <div>Count {count}</div>
    </>
  );
}
